class SearchChuzu(SearchBase):

    def __init__(self,params=None):

        if params:
            headers_list = params.get('headers_list')
            cookies_list = params.get('cookies_list')
            data = params.get('data')
            super().__init__(headers_list =headers_list,cookies_list=cookies_list,data=data)
        else:
            super().__init__()
        self.url_list = []
        self.mongo = MongoChengJiApi()
        self.gfs = GFS('zf','cjzf')
        self.dbname,self.setname = self.gfs.createDB()
        self.generation = Generation()
        self.proxies_tools = ProxyTool()

    def crawl_detail_html_urls(self,page_url,proxies= None):

        res = self.get(page_url,proxies=proxies)
        res_text = res.text
        if res.text.find('免费发布信息') == -1:
            print(res.status_code,'-'*20)
        return res_text
    def crawl_detail_html(self,detail_url,proxies = None):

        res = self.get(detail_url,proxies=proxies)
        res_text = res.text
        return res_text

    def crawl_detail_picture(self,pic_url,proxies = None):

        picture = self.get(pic_url,proxies = proxies).content
        return picture



